import React, { Component } from 'react'
import FullWidthGrid from './layout'

export default class Booking extends Component {
    constructor(props){
        super(props)
        this.state = {
            uid:"s2234",
            last_name: "",
            first_name: "",
            email:"",
            mobile_phone:"",
        }
    }
    handleSubmit1= (event) =>{
        
        let url="http://127.0.0.1:8080/v2/user";
        const data=this.state;
        fetch(url,{
            method: 'post',
            headers:{
                'content-type':'application/json',
                'accept':'application/xml'
            },
            body: JSON.stringify(data)
        }).then((result) => {
            result.json().then((resp)=>{
                console.log(resp)
                if(resp==="Succeed"){
                    this.props.history.push('./signin')
                }
                else if(resp==="Wrong email"){
                    alert("wrong email format,please check")
                }
                else if(resp==="User has existed"){
                    alert("user has existed,please change your email or log in")
                }
                else if(resp==="Incorrect information"){
                    alert("incorrect information,please check!")
                }
                
            })
        })
    }  


    handleInputChange = (event) =>{
        event.preventDefault()
        this.setState({
            [event.target.name] : event.target.value
        })
    }

    render(){
        return (
            <>
            <FullWidthGrid></FullWidthGrid>
            { <div className="back-ground">
            <div className="main">
                <div className="main-content">
                    <h2>Your Booking details</h2>
                    <table>
                        <tr>
                            <td className="Property-detail">
                            <div >
                                <h3>property detail</h3>
                                <p>Hotel Name:</p>
                                <p>Address:</p>
                                <p>Date:</p>
                            </div>
                            </td>
                            <td className="table-space-column">

                            </td>
                            <td className="Payment-detail">
                                <div >
                                    <h3>Payment-detail</h3>
                                </div>
                                
                            </td>
                        </tr>
                        <tr className="table-space-row">

                        </tr>
                        <tr>
                            <td className="Personal-information">
                            <div >
                                <h3>Personal infomation</h3>
                                <div className="guest-box">
                                    <p>Last name:
                                    <input type="text" name="last_name" value={last_name}
                                    onChange={this.handleInputChange}/></p>
                                    <p>First name:
                                    <input type="text" name="first_name" value={first_name}
                                    onChange={this.handleInputChange}/></p>
                                    <p>Email:
                                    <input type="text" name="email" value={email}
                                    onChange={this.handleInputChange}/></p>
                                    <p>Mobile phone:
                                    <input type="text" name="mobile_phone" value={mobile_phone}
                                    onChange={this.handleInputChange}/></p>
                                </div>    
                            </div>

                            </td>
                            <td className="table-space-column">

                            </td>
                            <td className="Payment-method">
                            
                                <h3>Payment-method</h3> 
                                
                            </td>
                        </tr>
                    </table>
            
                    <button className="btn-booking" onClick={()=>this.handleSubmit1()}>
                            Confrim
                        </button>    
                </div>
                </div>
                </div>

            
            }
            </>  
        );
    }
}
